import React, { Component } from 'react';

class Img extends Component {
    constructor(props){
        super(props);
        this.handleClick = this.handleClick.bind(this)
    }

    handleClick(){
        // console.log(this.props.index)
        this.props.onClick(this.props.index)
    }

    render(){
        return (
            <button style={this.props.style}><img onClick={this.handleClick} index={this.props.index} src={this.props.src}/></button>
        );
    }
};

export default Img;
